window.bookSummaryJSON = "<p><b>A new novel in the beloved </b><b><i>New York Times</i></b><b> best-selling Longmire series. </b></p> <p>When Lolo Long's niece, Jaya, begins receiving death threats, Tribal Police Chief Long calls on Absaroka County Sheriff Walt Longmire along with Henry Standing Bear as lethal backup. Jaya Longshot Long is the phenom of the Lame Deer Lady Stars High School basketball team and is following in the steps of her older sister, who disappeared a year previously, a victim of the scourge of missing Native Woman in Indian Country. Lolo hopes that having Longmire involved might draw some public attention to the girl's plight, but with this maneuver, she also inadvertently places the good sheriff in a one-on-one with the deadliest adversary he has ever faced in both this world and the next.</p>"; 
